import React from "react";

const HouseOfModels = () => {
  return (
    <section className="relative bg-gray-900 text-gray-300 py-16 px-4">
      {/* Section: House of Models Library */}
      <div className="flex flex-col items-center space-y-4">
        <div className="w-full max-w-2xl text-center">
          <p className="text-lg font-medium text-gray-400">House of Models Library</p>
        </div>
      </div>

      {/* Section: Under the Hood */}
      <div className="mt-12 text-center">
        <h1 className="text-6xl font-medium text-white leading-tight">
          Under the{" "}
          <span
            className="bg-clip-text text-transparent"
            style={{
              backgroundImage:
                "linear-gradient(97.4768deg, rgb(255, 58, 186) 0%, rgb(243, 173, 255) 56.7708%, rgb(98, 72, 255) 100%)",
            }}
          >
            hood
          </span>
        </h1>
      </div>

      {/* Section: Description */}
      <div className="mt-8 text-center">
        <p className="text-lg text-gray-400">
          Site Builder utilizes a built-in design system and component library of 1000+ components
          made for Figma &amp; Webflow.
        </p>
      </div>

      {/* Decorative Elements */}
      <div className="absolute top-0 left-0 w-10 h-10 bg-pink-500 rounded-full blur-xl opacity-50"></div>
      <div className="absolute bottom-0 right-0 w-10 h-10 bg-purple-500 rounded-full blur-xl opacity-50"></div>
    </section>
  );
};

export default HouseOfModels;
